import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Movies from './Navigation/NavigationPages/Movies';
import TvSeries from './Navigation/NavigationPages/TvSeries';
import People from './Navigation/NavigationPages/People';
import Collections from './Navigation/NavigationPages/Collections';
import Trending from './Navigation/NavigationPages/Trending';


const Routes =()=>(
    <Switch>
        <Route exact path="/" />
        <Route path="/movies" component={Movies}/>
        <Route  path="/tvseries" component={TvSeries}/>
        <Route  path="/people" component={People}/>
        <Route  path="/collections" component={Collections}/>
        <Route  path="/trending" component={Trending}/>

    </Switch>
)
export default Routes;
